import React from "react";
import { NavLink } from "react-router-dom";

const B_com = () => {
  return (
    <>
      {/* <!DOCTYPE html> */}
      <html lang="en">
        <head>
          <meta charset="UTF-8" />
          <meta http-equiv="X-UA-Compatible" content="IE=edge" />
          <meta name="viewport" content="width=device-width, initial-scale=1.0" />
          <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/css/bootstrap.min.css" />
          <title>Document</title>
        </head>
        <body>
          <div className="container">
            <h3>Syllabus</h3>
            <NavLink className="btn btn-outline-primary" to="B_Com_sylabuss/" role="button">Syllabus of B. Com </NavLink>
          </div><br /><br />

          <div className="container">
            <h3>Videos by Faculty Members </h3>
            <NavLink className="btn btn-outline-primary" to="/b_com/videos" role="button">Start Watching</NavLink>
          </div>
        </body>
      </html>
    </>
  );
};
export default B_com;
